import ProfileImg from "./images/welcome.png";
import "./Card.css";

class Card extends Component {
  render() {
    return <div className='Card'>
        <a href="https://welcome.proctor-webworks.com">
            <div className="card-category hvr-grow hvr-sweep-to-bottom" style={{backgroundImage: "url(images/welcome.png)"}}>
                <p>
                    A ruby on rails app that helps expats
                    navigate moving to a new country. It
                    was developed in the last 2 weeks at
                    le wagon.
                </p>
            </div>
        </a>
    </div>;
  }
}
export default Card;
